import{_ as e,o as t,c as r,U as o}from"./chunks/framework.70292381.js";const f=JSON.parse('{"title":"安卓的注解支持","description":"","frontmatter":{"title":"安卓的注解支持","date":"2016-03-25T00:00:00.000Z","sidebar":"auto","categories":["Android"],"tags":["注解"],"publish":true},"headers":[],"relativePath":"posts/2016-03-25-安卓的注解支持.md","filePath":"posts/2016-03-25-安卓的注解支持.md"}'),a={name:"posts/2016-03-25-安卓的注解支持.md"},n=o('<h3 id="url" tabindex="-1"><a href="https://developer.android.com/reference/android/support/annotation/package-summary.html" target="_blank" rel="noreferrer">url</a> <a class="header-anchor" href="#url" aria-label="Permalink to &quot;[url](https://developer.android.com/reference/android/support/annotation/package-summary.html)&quot;">​</a></h3><p>发现一个很好的总结<a href="http://www.flysnow.org/2015/08/13/android-tech-docs-support-annotations.html?utm_source=tuicool&amp;utm_medium=referral" target="_blank" rel="noreferrer">http://www.flysnow.org/2015/08/13/android-tech-docs-support-annotations.html?utm_source=tuicool&amp;utm_medium=referral</a></p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/AnimatorRes.html" target="_blank" rel="noreferrer">AnimatorRes</a> Denotes that an integer parameter, field or method return value is expected to be an animator resource reference (e.g. <a href="https://developer.android.com/reference/android/R.animator.html" title="android.R.animator.fade_in" target="_blank" rel="noreferrer">fade_in</a>).</p></blockquote><p>代表这个整形的参数，属性或者方法的值(返回值)是一个动画(animator)资源的引用 例如：android.R.animator.fade_in</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/AnimRes.html" target="_blank" rel="noreferrer">AnimRes</a> Denotes that an integer parameter, field or method return value is expected to be an anim resource reference  (e.g. <a href="https://developer.android.com/reference/android/R.anim.html" title="android.R.anim.fade_in" target="_blank" rel="noreferrer">fade_in</a>).</p></blockquote><p>代表这个整形的参数，属性或者方法的值(返回值)是一个动画(anim)资源的引用 例如：android.R.anim.fade_in</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/AnyRes.html" target="_blank" rel="noreferrer">AnyRes</a> Denotes that an integer parameter, field or method return value is expected to be a resource reference of any type. If the specific type is known, use one of the more specific annotations instead, such as <a href="https://developer.android.com/reference/android/support/annotation/StringRes.html" target="_blank" rel="noreferrer">StringRes</a> or <a href="https://developer.android.com/reference/android/support/annotation/DrawableRes.html" target="_blank" rel="noreferrer">DrawableRes</a>.</p></blockquote><p>代表这个整形的参数，属性或者方法的值(返回值)是一个资源引用的任何类型。如果这个指定的资源是已知的，使用一个更确定的注解代替 例如 StringRes 注解或者 DrawableRes 注解。</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/ArrayRes.html" target="_blank" rel="noreferrer">ArrayRes</a> Denotes that an integer parameter, field or method return value is expected to be an array resource reference (e.g. <a href="https://developer.android.com/reference/android/R.array.htm" title="android.R.arraay.phoneTypes" target="_blank" rel="noreferrer">phoneTypes</a>).</p></blockquote><p>代表这个整形的参数，属性或者方法的值(返回值)是一个数组资源的引用 例如：android.R.arraay.phoneTypes</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/AttrRes.html" target="_blank" rel="noreferrer">AttrRes</a> Denotes that an integer parameter, field or method return value is expected to be an attribute reference (e.g. <a href="https://developer.android.com/reference/android/R.attr.html" title="android.R.attr.action" target="_blank" rel="noreferrer">action</a>).</p></blockquote><p>代表这个整形的参数，属性或者方法的值(返回值)是一个属性资源的引用 例如：android.R.attr.action</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/BinderThread.html" target="_blank" rel="noreferrer">BinderThread</a> Denotes that the annotated method should only be called on the binder thread. If the annotated element is a class, then all methods in the class should be called on the binder thread. Example: @BinderThread  public BeamShareData createBeamShareData() { ...  }</p></blockquote><p>代表这个注解的方法只应该在绑定的线程调用。如果注解的在类上，那么这个类的所有方法都应该在绑定的线程上调用。</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/BoolRes.html" target="_blank" rel="noreferrer">BoolRes</a> Denotes that an integer parameter, field or method return value is expected to be a boolean resource reference.</p></blockquote><p>代表这个整形的参数，属性或者方法的值(返回值)是一个布尔 ( boolean ) 资源的引用</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/CallSuper.html" target="_blank" rel="noreferrer">CallSuper</a> Denotes that any overriding methods should invoke this method as well. Example: CallSuper  public abstract void onFocusLost();</p></blockquote><p>代表任何 overriding 方法都应该调用这个方法</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/CheckResult.html" target="_blank" rel="noreferrer">CheckResult</a> Denotes that the annotated method returns a result that it typically is an error to ignore. This is usually used for methods that have no side effect, so calling it without actually looking at the result usually means the developer has misunderstood what the method does. Example: ublic @CheckResult String trim(String s) { return s.trim(); } ...  s.trim(); // this is probably an error  s = s.trim(); // ok }</p></blockquote><p>代表方法的返回值通常被忽略从而导致错误的调用。通常使用在没有副作用的方法上，所以在调用方法的时候忽略方法的返回值意味着调用者不理解这个方法的作用。 例如 trim 方法 s.trim();//错误的调用，没用注意到方法的返回值，错误的理解为调用此方法就会将 s 字符串去空格。正确的使用方法应该是：s = s.trim();</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/ColorInt.html" target="_blank" rel="noreferrer">ColorInt</a> Denotes that the annotated element represents a packed color int, AARRGGBB If applied to an int array, every element in the array represents a color integer. Example: ublic abstract void setTextColor(@ColorInt int color);</p></blockquote><p>被注解的元素是一个包装之后的颜色整型值 ( 格式：AARRGGBB )，如果作用在整型数组上说明数组中的每一个值都代表一个颜色值</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/ColorRes.html" target="_blank" rel="noreferrer">ColorRes</a> Denotes that an integer parameter, field or method return value is expected to be a color resource reference (e.g. <a href="https://developer.android.com/reference/android/R.color.html" title="android.R.color.black" target="_blank" rel="noreferrer">black</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个颜色的资源值。例如：android.R.color.black</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/DimenRes.html" target="_blank" rel="noreferrer">DimenRes</a> Denotes that an integer parameter, field or method return value is expected to be a dimension resource reference (e.g. <a href="https://developer.android.com/reference/android/R.dimen.html" title="android.R.dimen.app_icon_size" target="_blank" rel="noreferrer">app_icon_size</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个尺寸的资源值。例如：android.R.dimen.app_icon_size</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/DrawableRes.html" target="_blank" rel="noreferrer">DrawableRes</a> Denotes that an integer parameter, field or method return value is expected to be a drawable resource reference (e.g. <a href="https://developer.android.com/reference/android/R.attr.html" title="android.R.drawable.alertDialogIcon" target="_blank" rel="noreferrer">alertDialogIcon</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 drawable 的资源值。例如：android.R.drawable.alertDialogIcon</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/FloatRange.html" target="_blank" rel="noreferrer">FloatRange</a> Denotes that the annotated element should be a float or double in the given rangeExample: FloatRange(from=0.0,to=1.0)  public float getAlpha() {      ...   }</p></blockquote><p>代表注解的元素应该是在给定范围内的一个浮点数或者双精度值</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/FractionRes.html" target="_blank" rel="noreferrer">FractionRes</a> Denotes that an integer parameter, field or method return value is expected to be a fraction resource reference.</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 fraction（分数）的资源值。</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/IdRes.html" target="_blank" rel="noreferrer">IdRes</a> Denotes that an integer parameter, field or method return value is expected to be an id resource reference (e.g. <a href="https://developer.android.com/reference/android/R.id.html" title="android.R.id.copy" target="_blank" rel="noreferrer">copy</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 id 的资源值。例如：android.R.id.copy</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/IntDef.html" target="_blank" rel="noreferrer">IntDef</a> Denotes that the annotated element of integer type, represents a logical type and that its value should be one of the explicitly named constants. If the IntDef#flag() attribute is set to true, multiple constants can be combined. Example: @Retention(SOURCE) //源码级别的注解,不被记录在 class 文件中 @IntDef({NAVIGATION_MODE_STANDARD,NAVIGATION_MODE_LIST,NAVIGATION_MODE_TABS}) public @interface NavigationMode {}//声明 navigationMode 注解 public static final int NAVIGATION_MODE_STANDARD = 0; public static final int NAVIGATION_MODE_LIST = 1; public static final int NAVIGATION_MODE_TABS = 2;  ... //参数 mode 的值只能是 intDef 中声明的值 public abstract void setNavigationMode(@NavigationMode int mode);</p></blockquote><blockquote><p>//函数的返回值只能是 intDef 中声明的值 @NavigationMode public abstract int getNavigationMode();</p></blockquote><blockquote><p>For a flag, set the flag attribute: @IntDef(     flag = true//此时注解的值可以是组合的形式 value ={NAVIGATION_MODE_STANDARD,NAVIGATION_MODE_LIST, NAVIGATION_MODE_TABS})</p></blockquote><p>用于生成一个注解 ( 用于限定输入或者返回的值 ) ，被这个注解标识的整型必须是在 IntDef 中声明的值。如果想要被标注的值可以以组合的形式输入 ( 用 &amp;,| 等符号连接) 则需要将 IntDef 中 flag 的值设置为 true。</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/IntegerRes.html" target="_blank" rel="noreferrer">IntegerRes</a> Denotes that an integer parameter, field or method return value is expected to be an integer resource reference (e.g. <a href="https://developer.android.com/reference/android/R.integer.html" title="android.R.integer.config_shortAnimTime" target="_blank" rel="noreferrer">config_shortAnimTime</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 integer 的资源值。例如：android.R.integer.config_shortAnimTime ( 一个短动画的持续时间,毫秒 )</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/InterpolatorRes.html" target="_blank" rel="noreferrer">InterpolatorRes</a> Denotes that an integer parameter, field or method return value is expected to be an interpolator resource reference (e.g. [cycle](<a href="https://developer.android.com/reference/android/R.interpolator.html" target="_blank" rel="noreferrer">https://developer.android.com/reference/android/R.interpolator.html</a> “ android.R.interpolator.cycle&quot;)).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个插值器的资源值。例如:android.R.interpolator.cycle</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/IntRange.html" target="_blank" rel="noreferrer">IntRange</a> Denotes that the annotated element should be an int or long in the given range Example: IntRange(from=0,to=255)  public int getAlpha() {     ...   }</p></blockquote><p>代表注解的元素是在给定范围内的一个 int 或者 long 值</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/Keep.html" target="_blank" rel="noreferrer">Keep</a> Denotes that the annotated element should not be removed when the code is minified at build time. This is typically used on methods and classes that are accessed only via reflection so a compiler may think that the code is unused. Example: Keep  public void foo() {     ...   }</p></blockquote><p>保证这个方法或者类不被混淆</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/LayoutRes.html" target="_blank" rel="noreferrer">LayoutRes</a> Denotes that an integer parameter, field or method return value is expected to be a layout resource reference (e.g. <a href="https://developer.android.com/reference/android/R.layout.html" title="android.R.layout.list_content" target="_blank" rel="noreferrer">list_content</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个布局的资源值。例如:android.R.layout.list_content</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/MainThread.html" target="_blank" rel="noreferrer">MainThread</a> Denotes that the annotated method should only be called on the main thread. If the annotated element is a class, then all methods in the class should be called on the main thread. Example: MainThread  public void deliverResult(D data) { ...  }</p></blockquote><p>被标注的方法只能运行在主线程上，如果被标注的元素是类那么这个类的所有方法都应该运行在主线程</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/MenuRes.html" target="_blank" rel="noreferrer">MenuRes</a> Denotes that an integer parameter, field or method return value is expected to be a menu resource reference.</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 menu 的资源值</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/NonNull.html" target="_blank" rel="noreferrer">NonNull</a> Denotes that a parameter, field or method return value can never be null. his is a marker annotation and it has no specific attributes.</p></blockquote><p>代表这个参数，属性或者方法的值不能为空。知识一个标记注解而且这个注解没有具体的属性</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/Nullable.html" target="_blank" rel="noreferrer">Nullable</a> Denotes that a parameter, field or method return value can be null.</p></blockquote><blockquote><p>When decorating a method call parameter, this denotes that the parameter can legitimately be null and the method will gracefully deal with it. Typically used on optional parameters.</p></blockquote><blockquote><p>When decorating a method, this denotes the method might legitimately return null.</p></blockquote><blockquote><p>This is a marker annotation and it has no specific attributes.</p></blockquote><p>代表这个参数，属性或者方法的值可以为空</p><p>当被用来标注方法的参数时，表示这个参数可以合理的为空并且这个方法会优雅的处理。通常被用于可选参数上</p><p>当被用来标注方法时，表示这个方法可能会返回空</p><p>这是一个标记注解，他没有具体的属性</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/PluralsRes.html" target="_blank" rel="noreferrer">PluralsRes</a> Denotes that an integer parameter, field or method return value is expected to be a plurals resource reference.</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 plurals(复数)的资源值 --表示木有遇到过--</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/RawRes.html" target="_blank" rel="noreferrer">RawRes</a> Denotes that an integer parameter, field or method return value is expected to be a raw resource reference.</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 raw 的资源值</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/Size.html" target="_blank" rel="noreferrer">Size</a> Denotes that the annotated element should have a given size or length. Note that &quot;-1&quot; means &quot;unset&quot;. Typically used with a parameter or return value of type array or collection. Example: ublic void getLocationInWindow(@Size(2) int[] location) {      ...   }</p></blockquote><p>被标注的元素的长度或大小必须是指定的值，其中-1 表示未设置。通常用在（类型是数组或集合的参数）or（返回值是数组或者集合的方法）中</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/StringDef.html" target="_blank" rel="noreferrer">StringDef</a> Denotes that the annotated String element, represents a logical type and that its value should be one of the explicitly named constants. Example: @Retention(SOURCE)//注解只存在源码中，不写入 class 文件 StringDef({POWER_SERVICE, WINDOW_SERVICE, LAYOUT_INFLATER_SERVICE  })  public @interface ServiceName {}//声明一个注解 public static final String POWER_SERVICE = &quot;power&quot;; public static final String WINDOW_SERVICE = &quot;window&quot;; public static final String LAYOUT_INFLATER_SERVICE = &quot;layout_inflater&quot;;  ...  //参数 name 的值只能是 StringDef 中的值 ublic abstract Object getSystemService(@ServiceName String name);</p></blockquote><p>用于生成一个注解 ( 用于限定输入或者返回的值 ) ，被这个注解标识的字符串必须是在 StringDef 中声明的值。如果想要被标注的值可以以组合的形式输入 ( 用 &amp;,| 等符号连接) 则需要将 StringDef 中 flag 的值设置为 true。</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/StringRes.html" target="_blank" rel="noreferrer">StringRes</a> Denotes that an integer parameter, field or method return value is expected to be a String resource reference (e.g. <a href="https://developer.android.com/reference/android/R.string.html" title="android.R.string.ok" target="_blank" rel="noreferrer">ok</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 String 的资源值, 例如:android.R.string.ok</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/StyleableRes.html" target="_blank" rel="noreferrer">StyleableRes</a> Denotes that an integer parameter, field or method return value is expected to be a styleable resource reference (e.g. <a href="https://developer.android.com/reference/android/R.styleable.html" title="android.R.styleable.TextView_text" target="_blank" rel="noreferrer">TextView_text</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 styleable 的资源值, 例如:android.R.styleable.TextView_text</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/StyleRes.html" target="_blank" rel="noreferrer">StyleRes</a> Denotes that an integer parameter, field or method return value is expected to be a style resource reference (e.g. <a href="https://developer.android.com/reference/android/R.style.html" title="android.R.style.TextAppearance" target="_blank" rel="noreferrer">TextAppearance</a>).</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 style 的资源值, 例如:android.R.style.TextAppearance</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/TransitionRes.html" target="_blank" rel="noreferrer">TransitionRes</a> Denotes that an integer parameter, field or method return value is expected to be a transition resource reference.</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 transition 的资源值</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/UiThread.html" target="_blank" rel="noreferrer">UiThread</a> Denotes that the annotated method or constructor should only be called on the UI thread. If the annotated element is a class, then all methods in the class should be called on the UI thread. Example: UiThread  public abstract void setText(@NonNull String text) { ...  }</p></blockquote><p>被注解的方法或者构造函数应该在 ui 线程被调用，如果标注在类上那么这个类的所有方法都应当运行在 ui 线程上</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/VisibleForTesting.html" target="_blank" rel="noreferrer">VisibleForTesting</a> Denotes that the class, method or field has its visibility relaxed, so that it is more widely visible than otherwise necessary to make code testable.</p></blockquote><p>你可以把这个注解标注到类、方法或者字段上，以便你在测试的时候可以使用他们。</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/WorkerThread.html" target="_blank" rel="noreferrer">WorkerThread</a> Denotes that the annotated method should only be called on a worker thread. If the annotated element is a class, then all methods in the class should be called on a worker thread. Example: (@WorkerThread protected abstract FilterResults performFiltering(CharSequence constraint);</p></blockquote><p>被注解的方法只能在工作线程被调用，如果标注在类上那么这个类的所有方法都应当只能在工作线程被调用</p><blockquote><p><a href="https://developer.android.com/reference/android/support/annotation/XmlRes.html" target="_blank" rel="noreferrer">XmlRes</a> Denotes that an integer parameter, field or method return value is expected to be an XML resource reference.</p></blockquote><p>代表这个整型的参数，属性或者方法的值（返回值）是一个 xml 的资源值</p>',86),l=[n];function i(d,p,s,c,h,u){return t(),r("div",null,l)}const b=e(a,[["render",i]]);export{f as __pageData,b as default};
